import React from "react";
import { Navbar, Nav, Image } from "react-bootstrap";
import "./hamburgermenu.css";

const HamburgerMenu = () => {
  return (
    <Navbar expand="md" className="d-block d-md-none">
      <Navbar.Brand>
        <Image src="HEALPH.png" alt="Sidebar Logo" fluid />
      </Navbar.Brand>
      <Navbar.Toggle aria-controls="responsive-navbar-nav" />
      <Navbar.Collapse id="responsive-navbar-nav">
        <Nav className="ml-auto"> {/* Use ml-auto class to push the hamburger button to the right */}
          {/* Add any other menu items you need here */}
        </Nav>
      </Navbar.Collapse>
    </Navbar>
  );
};

export default HamburgerMenu;
